import React from 'react';
import Calendar from './Calendar.js'
import format from "date-fns/format";

const CalendarOutput = (props) => {

    const allStartTimes = [];
    const allEndTimes = [];
    const busyBlocksToAdd = [];

    const fetchTest = () => {
        // Format start date to 8am
        var start = new Date(props.startDate)
        start.setHours(8)
        start.setMinutes(0)
        start.setSeconds(0)
        start = start.toISOString();

        // Format end date to 8 pm
        var end = new Date(props.startDate)
        end.setHours(20)
        end.setMinutes(0)
        end.setSeconds(0)
        end = end.toISOString();

        console.log(start)
        console.log(end)

        // Build request body
        const request = {}
        request.timeMin = start;
        request.timeMax = end;
        request.timeZone = "EST";

        // Create calendars object
        let cals = []
        for (let i=0; i<props.selectedCalendars.length; i++){
            let calObj = {}
            calObj.id = props.selectedCalendars[i]
            cals.push(calObj)
        }
        // const cal = {}
        // cal.id =  "bendixtmb@gmail.com" // props.selectedCalendars[0]

        request.items = cals

        console.log(request)

        return freeRequest = gapi.client.calendar.freebusy.query(request)

              .then(function(response) {
                console.log("Frebusy response: ", response);
                console.log("Frebusy response2: ", response.result);      
              },
              function(err) { console.error("Execute error", err); });
      }


    const fetchFreeBusy = () => {
        inputDate = props.startDate;

        if (inputDate.length < 2) {
          console.log("input is less than 2, default to Today as input date");
          inputDate = new Date();

          inputDate.setHours(8);
          inputDate.setMinutes(0);
          inputDate.setSeconds(0);
        }
        inputDate = new Date(inputDate);

        inputDate2 = props.endDate;

        if (inputDate2.length > 2) {
          inputDate2 = new Date(inputDate2);
          inputDate2.setHours(inputDate2.getHours()+20);

        } else {
          inputDate2 = new Date(inputDate);
          inputDate2.setHours(inputDate.getHours()+24);

        }

        inputDate5 = inputDate.toISOString();
        inputDate6 = inputDate2.toISOString();

        start = inputDate.getDate()
        end = inputDate2.getDate()
        console.log("start " + start + " end " + end)
        diff = end - start;
        console.log("diff: " + diff)

        for (let x=0; x < diff; x++){
          startdate = inputDate

          day = startdate.getDate()

          curDateDay = day + x

          //appendPre(curDateDay)
          morningBusyStart = new Date()
          morningBusyStart.setDate(curDateDay)
          morningBusyStart.setHours(8)
          morningBusyStart.setMinutes(0)
          morningBusyStart.setSeconds(0)
          morningBusyStart.setFullYear(inputDate.getFullYear())

          morningBusyEnd = new Date()
          morningBusyEnd.setDate(curDateDay)
          morningBusyEnd.setHours(8)
          morningBusyEnd.setMinutes(30)
          morningBusyEnd.setSeconds(0)
          morningBusyEnd.setFullYear(inputDate.getFullYear())


          nightBusyStart = new Date()
          nightBusyStart.setDate(curDateDay)
          nightBusyStart.setHours(20)
          nightBusyStart.setMinutes(0)
          nightBusyStart.setSeconds(0)
          nightBusyStart.setFullYear(inputDate.getFullYear())

          nightBusyEnd = new Date()
          nightBusyEnd.setDate(curDateDay)
          nightBusyEnd.setHours(20)
          nightBusyEnd.setMinutes(30)
          nightBusyEnd.setSeconds(0)
          nightBusyEnd.setFullYear(inputDate.getFullYear())

          // prettyStartTime = morningBusyStart.toLocaleString('en-US', { timeZone: 'EST' });
          // prettyEndTime = morningBusyEnd.toLocaleString('en-US', { timeZone: 'EST' });
          var morningBusyStart_formatted = {date: morningBusyStart};
          var morningBusyEnd_formatted = {date: morningBusyEnd};

          var nightBusyStart_formatted = {date: nightBusyStart};
          var nightBusyEnd_formatted = {date: nightBusyEnd};

          allStartTimes.push(morningBusyStart_formatted);
          allEndTimes.push(morningBusyEnd_formatted);

          allStartTimes.push(nightBusyStart_formatted);
          allEndTimes.push(nightBusyEnd_formatted);

          timecombo = [morningBusyStart, morningBusyEnd];
          busyBlocksToAdd.push(timecombo);

        }
        // Format in ISO
        inputDate = inputDate.toISOString();
        inputDate2 = inputDate2.toISOString();

        return freeRequest = gapi.client.calendar.freebusy.query({

              items: inputCals,
              timeMin: inputDate5,
              timeMax: inputDate6,
              timeZone: "-0500",
          })


              .then(function(response) {
                console.log("Frebusy response: ", response);
                console.log("Frebusy response2: ", response.result);
                console.log("array length: ", inputCals.length);


                // for (k = 0; k < inputCals.length; k++) {
                //   var curCal = inputCals[k].id;
                //   console.log("Current calendar: ", curCal);
                //   console.log("Iteration: k = " + k)

                //   var busyTimes = response.result.calendars[curCal].busy;

                //   for (i = 0; i < busyTimes.length; i++){
                //     var busyBlock = busyTimes[i];
                //     console.log("Busy block for " + curCal, busyBlock);

                //     var startTime = busyBlock.start;
                //     var endTime = busyBlock.end;

                //     var data = {date: startTime};
                //     var data2 = {date: endTime};

                //     allStartTimes.push(data);
                //     allEndTimes.push(data2);
                //     }
                // }

                // consolidateAllBusyTimes();

              },
              function(err) { console.error("Execute error", err); });
      }




    //   fetchTest()

     return (
    <div className="todo-container">
    <h4>Selected calendars: </h4>
    <br />

    <ul className='todo-list'>
    {
        props.selectedCalendars.map((cal, index, originalArray) => {
            return (
                <li>{cal}</li>
            )
        })
    }
    </ul>
    <h2>hi {format(props.startDate, "MM-dd-yyyy")}</h2>
    <br />
    <br />
    <button onClick={fetchTest}> fetch here </button>

    </div>

     );
}

export default CalendarOutput;
